import React from "react";

export const Header = () => {
  return (
    <>
      <div class="page-main-heading sticky-top py-myhead px-3 mb-3 w-100">
        <div class="pl-xl-0">
          <h5 class="font-weight-semibold mb-1">Home</h5>
          <p class="text-muted mb-0">Welcome to SiteName Dashboard !</p>
        </div>
      </div>
    </>
  );
};
